INSERT INTO `articles` VALUES ('1', '0', '2', null, '成为高级 PHP 程序员的第一步——调试（xdebug 原理篇）', '音乐,爱情', '11', '<ol><li>IDE（比如 PhpStorm ，下文所述的客户端）中已经集成了一个遵循 BGDp 的 Xdebug 插件。当要 debug 的时候，点击一些 IDE 的某个按钮，启动这个插件。该插件会启动一个 9000 的端口监听远程服务器发过来的 debug 信息。phpstorm 中，开启 / 关闭的位置为：工具栏 &gt; Run &gt; Start / Stop Listening for PHP Xdebug Connetions</li><li>浏览器向 Httpd 服务器发送一个带有 XDEBUG_SESSION_START 参数的请求，服务器收到这个请求之后交给后端的PHP（已开启 xdebug 模块）进行处理。</li><li>Php 看到这个请求是带了 XDEBUG_SESSION_START 参数，就告诉 Xdebug，“嘿，我要debug喔，你准备一下”。这时，Xdebug 会向来源 ip 客户端的9000端口（默认是 9000 端口）发送一个debug请求，然后客户端的 9000 端口响应这个请求，那么 debug 就开始了。这里通知客户端其实有两种方式，根据 xdebug 的配置&nbsp;xdebug.remote_connect_back = 0 | 1&nbsp;使用不同的通知方式，下文会详细介绍</li><li>Php 知道 Xdebug 已经准备好了，那么就开始开始一行一行的执行代码，但是每执行一行都会让 Xdebug 过滤一下，Xdebug 在过滤每一行代码的时候，都会暂停代码的执行，然后向客户端的 9000 端口发送该行代码的执行情况，等待客户端的决策（是一句代码还是下一个断点待）。。</li><li>相应，客户端（IDE）收到 Xdebug 发送过来的执行情况，就可以把这些信息展示给开发者看了，包括一些变量的值等。同时向 Xdebug 发送下一步应该什么。</li></ol><h3>以上就是整个工作流程，下面介绍一下两种通知客户端的方式：<a href=\"https://laravel-china.org/articles/4090#以上就是整个工作流程下面介绍一下两种通知客户端的方式\">#</a></h3><p>Xdebug 的官方文档给了两张很清楚的交互图</p><h4>第一种，静态绑定客户端 host<a href=\"https://laravel-china.org/articles/4090#第一种静态绑定客户端-host\">#</a></h4><p>xdebug.remote_connect_back = 0&nbsp;，也是 xdebug 的默认方式，这种情况下，xdebug 在收到调试通知时会读取配置&nbsp;xdebug.remote_host&nbsp;和&nbsp;xdebug.remote_port&nbsp;，默认是 localhost:9000，然后向这个端口发送通知</p><p><br></p>', '59', '0', '2017-03-12 19:34:26', '2017-03-16 16:06:51'), ('2', '0', '2', 'images/201703121939221489318762.2808963.png', '依赖注入', null, '我们可以用一个简单的例子来说明依赖注入的概念\n\n下面的代码中有一个 Database 的类，它需要一个适配器来与数据库交互。我们在构造函数里实例化了适配器，从而产生了耦合。这会使测试变得很困难，而且 Database 类和适配器耦合的很紧密。', '<p>我们可以用一个简单的例子来说明依赖注入的概念</p><p>下面的代码中有一个&nbsp;Database&nbsp;的类，它需要一个适配器来与数据库交互。我们在构造函数里实例化了适配器，从而产生了耦合。这会使测试变得很困难，而且&nbsp;Database&nbsp;类和适配器耦合的很紧密。</p><p><br></p>', '7', '1', '2017-03-12 19:39:22', '2017-03-13 18:59:04'), ('3', '0', '2', 'images/201703131106051489374365.2808593.jpeg', '生成编辑器（使用element）', '存储', '上一个章节描述了如何使用html元素的ID来生成编辑器，可以通过<div>和<textarea>元素生成。从v2.1.4版本开始，wangEditor支持使用element元素生成编辑器，代码如下：', '<p>上一个章节描述了如何使用html元素的<code>ID</code>来生成编辑器，可以通过<code>&lt;div&gt;</code>和<code>&lt;textarea&gt;</code>元素生成。从<code>v2.1.4</code>版本开始，wangEditor支持使用<code>element</code>元素生成编辑器，代码如下：<br></p><p><br></p>', '16', '0', '2017-03-13 11:06:05', '2017-03-13 20:33:40'), ('4', '0', '2', 'images/201703131106371489374397.0485541.jpeg', 'Vue.js 是什么', null, 'Vue.js（读音 /vjuː/, 类似于 view） 是一套构建用户界面的 渐进式框架。与其他重量级框架不同的是，Vue 采用自底向上增量开发的设计。Vue 的核心库只关注视图层，并且非常容易学习，非常容易与其它库或已有项目整合。另一方面，Vue 完全有能力驱动采用单文件组件和 Vue 生态系统支持的库开发的复杂单页应用。', '<p>Vue.js（读音 /vjuː/, 类似于&nbsp;<strong>view</strong>） 是一套构建用户界面的&nbsp;<strong>渐进式框架</strong>。与其他重量级框架不同的是，Vue 采用自底向上增量开发的设计。Vue 的核心库只关注视图层，并且非常容易学习，非常容易与其它库或已有项目整合。另一方面，Vue 完全有能力驱动采用<a href=\"https://cn.vuejs.org/v2/guide/single-file-components.html\">单文件组件</a>和&nbsp;<a href=\"https://github.com/vuejs/awesome-vue#libraries--plugins\">Vue 生态系统支持的库</a>开发的复杂单页应用。<br></p><p><br></p>', '6', '0', '2017-03-13 11:06:37', '2017-03-13 20:17:11'), ('5', '0', '2', null, 'iView2 来了，全面支持 Vue.js 2.x', null, '两个星期的紧张开发，iView 终于发布了支持 Vue.js 2.x 的 2.0.0-rc.1 版本。\n该版本以 iView 1.x 为基础进行修改，完全保留了 43 个 UI 组件，针对 Vue 2.x 的特性，对一些 API 进行了调整，比如表单类组件充分利用 v-model 来替代 .sync。整体性能也大幅度提升。', '<p>两个星期的紧张开发，iView 终于发布了支持 Vue.js 2.x 的 2.0.0-rc.1 版本。<br>该版本以 iView 1.x 为基础进行修改，完全保留了 43 个 UI 组件，针对 Vue 2.x 的特性，对一些 API 进行了调整，比如表单类组件充分利用 v-model 来替代 .sync。整体性能也大幅度提升。<br></p><p><br></p>', '0', '0', '2017-03-13 11:08:32', '2017-03-13 11:08:32'), ('6', '0', '2', null, 'Laravel5.4，广播事件,pusher 的配置以及使用', null, '最近要写一个聊天室，于是了解了一下laravel的事件广播，参考资料来源于http://laravelacademy.org/post/5351.html, 但是在跟随博主动手的时候, 发现事件成功触发， 但是pusher调试控制台上并没有收到事件。经过调试找到问题所在。#', '<h3>最近要写一个聊天室，于是了解了一下laravel的事件广播，参考资料来源于http://laravelacademy.org/post/5351.html, 但是在跟随博主动手的时候, 发现事件成功触发， 但是pusher调试控制台上并没有收到事件。经过调试找到问题所在。<a href=\"https://laravel-china.org/articles/4106#最近要写一个聊天室于是了解了一下laravel的事件广播参考资料来源于httplaravelacademyorgpost5351html-但是在跟随博主动手的时候-发现事件成功触发-但是pusher调试控制台上并没有收到事件经过调试找到问题所在\">#</a></h3><p><br></p>', '6', '0', '2017-03-13 11:09:47', '2017-03-13 20:19:01');
COMMIT;

